    setInput (e.target.value);
   }

  return (
    <div>
      <center>

          <input type="text" name="input"  value={input} onChange={Handler} /><br/>
        <button onClick={()=>setresult(eval(input))}>result</button>

          {eval(input)}

      </center>
    </div>
  )
}

export default App
